function getDiagram(r,e,t,a,o){t=JSON.parse(document.getElementById(t).value),a=document.getElementById(a).getContext("2d");new Chart(a,{type:r,data:{labels:Object.keys(t),datasets:[{label:o,data:Object.values(t),backgroundColor:getBackgroundColors(),borderColor:getBorderColor(),borderWidth:1}]},options:{legend:{position:e}}})}function getBackgroundColors(){return["rgba(255, 99, 132, 0.2)","rgba(54, 162, 235, 0.2)","rgba(255, 206, 86, 0.2)","rgba(75, 192, 192, 0.2)","rgba(153, 102, 255, 0.2)","rgba(255, 159, 64, 0.2)"]}function getBorderColor(){return["rgba(255, 99, 132, 1)","rgba(54, 162, 235, 1)","rgba(255, 206, 86, 1)","rgba(75, 192, 192, 1)","rgba(153, 102, 255, 1)","rgba(255, 159, 64, 1)"]}